import React from "react";
import Layout from "../components/"
import { Container, Row, Col } from "reactstrap";

class News extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (<Container>News</Container>);
  }
}

export default News;
